const notesAndUserData = {
    currentUser: {
        username: ""
    },
    users: [
        {
            username: "email",
            password: "sdi",
        },
        {
            username: "ajkdf",
            password: "sdf",
        },
        {
            username: "dsf",
            password: "sdf",
        },
        {
            username: "sdf",
            password: "sdf",
        },
        {
            username: "ksadhf",
            password: "sdf",
        }
    ],
    notes: {
        "1": [
            {
                id: 1,
                title: "some thing",
                description: " some valueds"
            },
            {
                id: 2,
                title: "something 2",
                description: "some notes"
            },
            {
                id: 3,
                title: "something 3",
                description: "some notes"
            }
        ]
    }
}
export default notesAndUserData;
